package one.mixin.android.ui.landing.country

import java.util.Locale

data class Country(
    val _code: String,
    var name: String? = null,
    val dialCode: String,
    // sorted by English name
    var englishName: String? = null,
    val flag: Int
) {
    var code: String = ""
        set(value) {
            field = value
            if (name.isNullOrEmpty()) {
                name = Locale("", code).displayName
                englishName = Locale("en", code).getDisplayName(Locale.ENGLISH)
                englishName?.let {
                    englishName = it.substring(it.indexOf('(') + 1)
                }
            }
        }

    init {
        code = _code
    }

    companion object {
        const val ENCODED_COUNTRY_CODE = ""
    }
}